  apiKey: "AIzaSyBJVdGjEab3OOYFN2FElupsHmp7FwFt1Hk",
  authDomain: "eesti-bikes-web.firebaseapp.com",
  projectId: "eesti-bikes-web",
  storageBucket: "eesti-bikes-web.appspot.com",
  messagingSenderId: "154509305802",
  appId: "1:154509305802:web:e335ac9b11fe646c309133",
  measurementId: "G-B6K52LZPYT"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);
